import ExpenseComponent from "./components/Expenses";
import "./App.css";

function App() {
  const expense = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "Food",
      amount: 1040.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e3",
      title: "Shampoo",
      amount: 50.12,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e4",
      title: "Toothe Paste",
      amount: 50.12,
      date: new Date(2020, 7, 14),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseComponent items={expense} />
    </div>
  );
}

export default App;
